  const classes = useStyles();
  return (
    <Router>
      <AppBar className={classes.appBar} position="static" color="inherit">
        <div className={classes.brandContainer}>
          <Typography
            component={Link}
            to="/"
            className={classes.heading}
            variant="h2"
            aligh="center"
          >
            Ricordi
          </Typography>
          {/* <img
            className={classes.image}
            src={memories}
            alt="memories"
            height="60"
          /> */}
        </div>
      </AppBar>
    </Router>
  );
};

export default NavBar;
